text:
L'impegno per sostenere economicamente chi ricorre ai servizi psicologici e per mettere la salute mentale tra le principali priorità del governo non si ferma: alle 16:30 parlo della nostra proposta sul #bonuspsicologo a @Radio1VivaVoce.
#noncifermiamo

@SenatoriPD 
@pdnetwork

Grazie al premier #Draghi e al ministro #Bianchi il rientro a scuola di oggi è stato una totale confusione e non ha evitato a molti classi il ricorso alla didattica a distanza. 
Tutto è stato fatto con un'approssimazione che pagano insegnanti e studenti.

@FratellidItalia #Scuole https://t.co/7Ccg1DLgoc

Lo #smartworking è il futuro, a prescindere dalla pandemia.

Non è solo una misura di contrasto al Covid, ma ci aiuta a ridurre l'inquinamento, ad abbassare i costi degli affitti, a far stare di più i genitori con i figli.

@ManlioDS #SkyTg24 https://t.co/ZbwScOwwUL

