Anche dopo le nostre richieste, il governo sarà in conferenza stampa per spiegare agli italiani le nuove misure.

@GiuseppeConteIT quando era premier ha comunicato agli italiani tutte le decisioni più difficili.

Finalmente #Draghi oggi ci mette la faccia, meglio tardi che mai!

